<script>
    function DeleteUser(UserId) {
        swal.fire({
            title: ""حذف کاربر"",
            text: ""آیا از حذف کاربر اطمینان دارید ؟"",
            icon: ""info"",
            showCancelButton: true,
            confirmButtonColor: ""#3085d6"",
            cancelButtonColor: ""d33"",
            confirmButtonText: 'بله انجام شود',
            cancelButtonText: 'خیر'
        }).then((result) => {
            if (result.value) {
                var postData = {
                    'userId': UserId,
                };

